import React, { useState } from 'react';
import axios from 'axios';

const Result = (props) => {
    const [result, setResult] = useState([]);

    const searchCourses = (i) => {
      axios.get(`http://localhost:5000/students/search/${props}`)
        .then((res) => {
          setResult(res.data);
        })
        .catch((err) => {
          console.log('ERR: ', err);
        })
    };
  
    return (
        <div>
            {
                props.result.map((course, i) => {
                    return <div key={i}>
                        {course.name}
                    </div>
                })}
        </div>
    )
}

export default Result
